import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Table, Button, Badge } from 'react-bootstrap';
import { testsAPI, candidatesAPI } from '../services/api';

function AdminDashboard() {
  const [stats, setStats] = useState({
    totalCandidates: 0,
    totalTests: 0,
    completedTests: 0,
    averageScore: 0
  });
  const [recentTests, setRecentTests] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      const [testsResponse, candidatesResponse] = await Promise.all([
        testsAPI.getAllSessions(),
        candidatesAPI.getAll()
      ]);

      const tests = testsResponse.data;
      const candidates = candidatesResponse.data;

      const completedTests = tests.filter(t => t.status === 'completed');
      const totalTests = tests.length;
      
      // Calculate average score (this would need to be implemented in the backend)
      const averageScore = completedTests.length > 0 ? 75 : 0; // Placeholder

      setStats({
        totalCandidates: candidates.length,
        totalTests: totalTests,
        completedTests: completedTests.length,
        averageScore: averageScore
      });

      setRecentTests(tests.slice(0, 10));
    } catch (error) {
      console.error('Failed to load dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const getStatusBadge = (status) => {
    switch (status) {
      case 'completed':
        return <Badge bg="success">Completed</Badge>;
      case 'active':
        return <Badge bg="primary">Active</Badge>;
      default:
        return <Badge bg="secondary">{status}</Badge>;
    }
  };

  return (
    <Container>
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Admin Dashboard</h2>
      </div>

      <Row className="mb-4">
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h3 className="text-primary">{stats.totalCandidates}</h3>
              <p className="mb-0">Total Candidates</p>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h3 className="text-info">{stats.totalTests}</h3>
              <p className="mb-0">Total Tests</p>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h3 className="text-success">{stats.completedTests}</h3>
              <p className="mb-0">Completed Tests</p>
            </Card.Body>
          </Card>
        </Col>
        <Col md={3}>
          <Card className="text-center">
            <Card.Body>
              <h3 className="text-warning">{stats.averageScore}%</h3>
              <p className="mb-0">Average Score</p>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Card>
        <Card.Header>
          <h5 className="mb-0">Recent Test Sessions</h5>
        </Card.Header>
        <Card.Body>
          <Table responsive hover>
            <thead>
              <tr>
                <th>Candidate Name</th>
                <th>Email</th>
                <th>Status</th>
                <th>Started At</th>
                <th>Completed At</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {recentTests.map((test) => (
                <tr key={test.id}>
                  <td>{test.candidate_name}</td>
                  <td>{test.candidate_email}</td>
                  <td>{getStatusBadge(test.status)}</td>
                  <td>{new Date(test.started_at).toLocaleDateString()}</td>
                  <td>
                    {test.completed_at 
                      ? new Date(test.completed_at).toLocaleDateString()
                      : '-'
                    }
                  </td>
                  <td>
                    {test.status === 'completed' && (
                      <Button
                        variant="outline-primary"
                        size="sm"
                        onClick={() => window.open(`/results/${test.session_token}`, '_blank')}
                      >
                        View Results
                      </Button>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        </Card.Body>
      </Card>
    </Container>
  );
}

export default AdminDashboard;
